import React from "react";

const Header = () =>{
	return (
    <div>
      <div class="header">
        <div class="header-inner">
          <div class="header-inner-main"> main </div>
          <div class="header-inner-catalog"> Каталог </div>
          <div class="header-inner-about"> О нас </div>
          <div class="header-inner-contacts"> Контакты </div>
        </div>
      </div>
      <div class="main"> Товары </div>
    </div>
  );
}

export default Header;
